import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "../note";
import CreateArea from "./CreateArea";

function App() {
    return <div>
        <Header />
        <CreateArea />
        {notes.map(note => (
            <Note 
                key={note.key} 
                title={note.title} 
                content={note.content} 
            />
        ))}
        <Footer />
    </div>
}

export default App;
